import React from 'react';
import './WorkoutList.css';

const WorkoutList = ({
  workout_id,
  name,
  day_type,
  plan_type,
  difficulty_level
}) => {
  return (
    <div key={workout_id} className='workout-container'>
      <div className='workout'>
        <div className='workout-title'>
          <h2 className='workout-title'>{name}</h2>
        </div>
        <div className='template-section'>
          <p className='day-type'>{day_type}</p>
        </div>
        <div className='template-section'>
          <p className='plan-type'>{plan_type}</p>
        </div>
        <div className='template-section'>
          <p className='difficulty_level'>{difficulty_level}</p>
        </div>

        <p className='workout-description'>
          Some details about the workout go here.
        </p>
      </div>
    </div>
  );
};

export default WorkoutList;
